import styled from 'styled-components';

const PostCardContainer = ({
	className,
	id,
	title,
	publishedAt,
	commentsCount,
	imageUrl,
}) => {
	return (
		<div className={className}>
			<img src={imageUrl} alt={title} />
			<div>{title}</div>
		</div>
	);
};

export const PostCard = styled(PostCardContainer)``;
